 create positive relationships that reduce costs and response time.</p>\r\n          </div>\r\n          <div class=\"col-sm-6 pull-left\">\r\n            <img src=\"/sites/all/themes/sonomaprecision/images/shop2.jpg\"/>\r\n          </div>\r\n        </div>\r\n          <p>Whether you need a one-off, quick response, prototype or a large scale production run we are here to meet your need and deliver excellence.</p>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:1583:\"<div class=\"about-us-bg\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-sm-6\">\n<h1>About Us</h1>\n</div>\n</div>\n</div>\n</div>\n<div class=\"about-us-body\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-sm-10 col-sm-offset-1\">\n<div class=\"row\">\n<div class=\"col-sm-6\">\n<p>Sonoma Precision Manufacturing Company was founded in 1987 to provide the growing high technology industry with a responsive state-of-the-art manufacturing facility that specialized in close tolerance, precision machined components and assemblies. Utilizing the most current machine tool technologies available, Sonoma Precision continues to provide total manufacturing solutions that meet or exceed customer expectations for Quality, Performance and Reliability.</p>\n</div>\n<div class=\"col-sm-6\">\n            <img src=\"/sites/all/themes/sonomaprecision/images/outside-shop.jpg\" /></div>\n</div>\n<div class=\"row\">\n<div class=\"col-sm-6 pull-right\">\n<p>Sonoma Precision\'s skilled staff excels at finding new approaches that maximize our tools to benefit our customers. We pride ourselves on our ability to utilize new technologies to reduce cost and increase efficiency. We also strive to partner with our customers to create positive relationships that reduce costs and response time.</p>\n</div>\n<div class=\"col-sm-6 pull-left\">\n            <img src=\"/sites/all/themes/sonomaprecision/images/shop2.jpg\" /></div>\n</div>\n<p>Whether you need a one-off, quick response, prototype or a large scale production run we are here to meet your need and deliver excellence.</p>\n</div>\n</div>\n</div>\n</div>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1460074676,1),('field:node:3','a:8:{s:4:\"body\";a:0:{}s:16:\"field_mill_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"10\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:12:\"HAAS-VF2.jpg\";s:3:\"uri\";s:23:\"public://HAAS-VF2_0.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:5:\"33297\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1459464418\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"600\";s:6:\"height\";s:3:\"550\";}}}s:14:\"field_y_travel\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:2:\"16\";s:6:\"format\";N;s:10:\"safe_value\";s:2:\"16\";}}}s:14:\"field_x_travel\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:2:\"30\";s:6:\"format\";N;s:10:\"safe_value\";s:2:\"30\";}}}s:14:\"field_z_travel\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:2:\"20\";s:6:\"format\";N;s:10:\"safe_value\";s:2:\"20\";}}}s:19:\"field_spindle_speed\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:5:\"10000\";s:6:\"format\";N;s:10:\"safe_value\";s:5:\"10000\";}}}s:17:\"field_tool_number\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:2:\"20\";s:6:\"format\";N;s:10:\"safe_value\";s:2:\"20\";}}}s:16:\"field_horizontal\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"0\";}}}}',0,1460074708,1),('field:node:4','a:8:{s:4:\"body\";a:0:{}s:16:\"field_mill_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"12\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:12:\"HAAS-VF6.jpg\";s:3:\"uri\";s:23:\"public://HAAS-VF6_0.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:7:\"1784570\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1459464512\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"5400\";s:6:\"height\";s:4: