INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'Yeah!!!!','','filtered_html'),('node','front_page',0,2,2,'und',0,'Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet ','','filtered_html'),('node','page',0,24,24,'und',0,'<div class=\"about-us-bg\">\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col-sm-6\">\r\n        <h1>About Us</h1>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n<div class=\"about-us-body\">\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col-sm-10 col-sm-offset-1\">\r\n        <div class=\"row\">\r\n          <div class=\"col-sm-6\">\r\n            <p>Sonoma Precision Manufacturing Company was founded in 1987 to provide the growing high technology industry with a responsive state-of-the-art manufacturing facility that specialized in close tolerance, precision machined components and assemblies. Utilizing the most current machine tool technologies available, Sonoma Precision continues to provide total manufacturing solutions that meet or exceed customer expectations for Quality, Performance and Reliability.</p>\r\n          </div>\r\n          <div class=\"col-sm-6\">\r\n            <img src=\"/sites/all/themes/sonomaprecision/images/outside-shop.jpg\"/>\r\n          </div>\r\n        </div>\r\n        <div class=\"row\">\r\n          <div class=\"col-sm-6 pull-right\">\r\n            <p>Sonoma Precision\'s skilled staff excels at finding new approaches that maximize our tools to benefit our customers. We pride ourselves on our ability to utilize new technologies to reduce cost and increase efficiency. We also strive to partner with our customers to create positive relationships that reduce costs and response time.</p>\r\n          </div>\r\n          <div class=\"col-sm-6 pull-left\">\r\n            <img src=\"/sites/all/themes/sonomaprecision/images/shop2.jpg\"/>\r\n          </div>\r\n        </div>\r\n          <p>Whether you need a one-off, quick response, prototype or a large scale production run we are here to meet your need and deliver excellence.</p>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>','','full_html');
/*!40000 ALTER TABLE `field_data_body` ENABLE KEYS */;
UNLOCK TABLES;

